INSERT INTO `post` VALUES (1,'2021-01-01 00:00:00.000000','한국의 전통음식을 제대로 느끼며 맛있는 음식과 함께한 소중한 순간을 가졌습니다.','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/91264382-f12a-426d-ad67-1e547eb265b2_2023-08-09.png','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/91264382-f12a-426d-ad67-1e547eb265b2_2023-08-09.png',1,0,'가족, 친구들과 함께 반나절 즐길 수 있는 네거리 골목의 집에서, 맛있는 갈비살과 함께 소주 한 잔 하며 모임의 분위기를 더해보고 싶습니다. ','2020-10-10 00:00:00.000000','1년이내',1,1,'2021-01-01 00:00:00.000000','소주에 갈비살 먹기',6,1),(2,'2022-12-12 00:00:00.000000','세계적인 도시 중 하나인 파리에서 문화와 역사, 그리고 맛있는 음식을 모두 경험했어요. ','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/1991726e-0f78-47bf-b5aa-a1333e374505_2023-08-07.png','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/1991726e-0f78-47bf-b5aa-a1333e374505_2023-08-07.png',2,0,'교양과 인문학을 쌓는 것 뿐 아니라 역사적인 유적지, 예술과 문화를 감상하며 여유로운 오랜시간을 느끼고 싶습니다.','2020-10-11 00:00:00.000000','5년이내',1,1,'2022-12-12 00:00:00.000000','파리 여행가기',1,2),(3,'2023-07-01 00:00:00.000000','인생에서 처음으로 한 번쯤은 시도하고 싶었던 것을 이뤄냈어요! 푸른 바다와 파도 위에서 물고기 같이 수영하는 느낌은 정말 감동적이었습니다.','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/23a45d3d-341c-4660-b762-94b539cc622b_2023-08-08.png','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/23a45d3d-341c-4660-b762-94b539cc622b_2023-08-08.png',1,0,'생명을 느끼며 바다 위를 헤엄친 즐거움을 느끼며 하루 종일 바다에서 느긋하도록 시간을 보내고 싶습니다. ','2020-10-12 00:00:00.000000','10년이내',1,1,'2023-07-01 00:00:00.000000','하와이에서 서핑보드 타기',2,3),(4,'2023-08-08 00:00:00.000000','인도 최고','','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/38e27d7b-38ae-4ce4-95ab-ebed7e394535_2023-08-08.png',2,0,'인도 가서 말이지! 현지 명물 각종 차, 커리 같은 음식도 많이 먹고 방라시, 고트라, 밤숟가락 등 역사적인 유적지 돌아다니며 설레는 시간을 보낸다!!!','2020-10-13 00:00:00.000000','언젠가',1,1,'2023-08-08 00:00:00.000000','인도 여행가기',1,1),(5,'2023-08-01 00:00:00.000000','처음에는 어렵게 느껴졌지만, 배우기 시작하면서 새로운 도전과 성취감이 들었다','','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/23ee614d-d4cf-494f-8750-5de648f01493_2023-08-09.png',3,0,'눈송이에 자신감 넘치게 스키장 간다! 스키도 좋지만 뱅뱅보드로 붐바야~! 몸 좀 떨어뜨리면서 멋진 기술들 연출해본다. ','2020-10-14 00:00:00.000000','언젠가',1,1,'2023-08-01 00:00:00.000000','스노우보드 배우기',2,2),(6,'2022-08-14 00:00:00.000000','근육 10kg 증량 성공!','','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_1/44b4361d-12e2-463f-a36b-4a92664f8bd0_2023-08-09.png',1,0,'운동 잘 안 하는 내가 해볼 수 있는 정도로 꾸준히 운동하는 습관 들이기! 그러면 일상생활에서도 좀 더 건강하게, 힘 좀 더 키우게 될 거야. ','2020-10-16 00:00:00.000000','언젠가',1,1,'2022-08-14 00:00:00.000000','꾸준히 운동해서 건강 유지하기',2,1),(7,'2022-12-26 00:00:00.000000','놀이기구 최고 짜릿해','','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_10/101fa8c5-aa96-44d7-98bf-bf91ceaa5d04_2023-08-09.png',2,1,'롤러코스터는 놀이기구 중 내가 가장 좋아하는 거였어! 속도와 높이에 대한 짜릿한 감정은 내 인생에서 단 한 번도 놓치고 싶지 않은 즐거움이지. ','2020-10-17 00:00:00.000000','언젠가',1,1,'2022-12-26 00:00:00.000000','롤러코스터 타기',4,2),(8,'2022-11-11 00:00:00.000000','건강하게 지내는 것은 인생에서 가장 중요한 가치 중의 하나라는 것을 깨달았습니다.','','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_3/fd721cb4-1294-4d6b-a0d7-6068900f6d1b_2023-08-08.png',3,2,'건강이 최고다! 이왕이면 아프지 않고 항상 건강한 상태로 나 자신을 유지하고 싶어. ','2020-10-18 00:00:00.000000','1년이내',1,1,'2022-11-11 00:00:00.000000','아프지 않고 건강하기',2,3),(9,'2023-03-22 00:00:00.000000','혼자서 공부하고 작업할 수 있는 노트북은 제 인생을 변화시키고 새로운 일들을 할 수 있게 해줬습니다.','','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_3/76dc9477-e8b0-4b24-9cac-1bf66147ab71_2023-08-08.png',4,0,'일상생활에서 편리하게 사용할 수 있는 노트북을 구매해서 이제 효율적으로 업무와 개인 작업도 다뤄볼 거야.','2020-10-19 00:00:00.000000','5년이내',1,1,'2023-03-22 00:00:00.000000','노트북 구매하기',7,1),(10,'2023-02-02 00:00:00.000000','휴대성이 좋아 항상 손에 들고 다양한 취미 및 업무를 쉽게 처리할 수 있게 해줬습니다.','','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_3/6da8a436-52ef-485c-98ff-47e50baa43ef_2023-08-09.png',1,0,'그림, 음악, 영화, 책, 게임, 노트... 해야할 일과 취미활동, 다양한 생활 정보들 다 있는 갤럭시탭 갖구 싶다! 내 작은 작업공간에서 다양한 작업들을 할 수 있는데!','2020-10-20 00:00:00.000000','5년이내',1,1,'2023-02-02 00:00:00.000000','갤럭시탭 구매하기',7,2),(11,'2022-02-22 00:00:00.000000','역사와 문화를 이해하면서 새로운 지식을 습득할 수 있으며 예술작품, 고대 유물들을 소중히 간직하게 됩니다.','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_3/3bd97b1a-2c96-4624-b565-824ed0dfa174_2023-08-08.png','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_3/3bd97b1a-2c96-4624-b565-824ed0dfa174_2023-08-08.png',2,1,'박물관에서 일주일동안 식겁하지 않고 볼 수 있는 전시회 보고 오고싶어! 유명 화가작품, 국내외 전시회 등 내 흥미를 유발하는 박물관에서의 문화적 시간이 내 맘에 들어!','2020-10-21 00:00:00.000000','10년이내',1,1,'2022-02-22 00:00:00.000000','루브루박물관 가기',4,3),(12,'2021-03-03 00:00:00.000000','시원한 속초 여행 성공!','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_3/3aacc6b3-c21a-416a-ad99-321eae45316f_2023-08-08.png','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_3/3aacc6b3-c21a-416a-ad99-321eae45316f_2023-08-08.png',3,1,'난 평소 바다에서 놀 때의 설레임과 행복한 기억 때문에 이 버킷리스트를 세웠어. 아직까지는 많이 갔지만, 한 번 더 가서 그 기분을 다시 한번 느끼고 싶어!','2020-10-22 00:00:00.000000','언젠가',1,1,'2021-03-03 00:00:00.000000','여름에 바다로 여행가기',1,1),(13,'2023-05-05 00:00:00.000000','노래방 100점 달성','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_2/e469787b-8b70-4194-85b6-4a8b92e756f7_2023-08-09.png','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_2/e469787b-8b70-4194-85b6-4a8b92e756f7_2023-08-09.png',4,0,'나는 음악을 좋아하고 취미로도 자주 듣거나 부르곤 해. 내 안의 예술가 정신이 깨어나서 다른 사람들에게 즐거움을 주는 가수가 되고 싶어! ','2020-10-23 00:00:00.000000','언젠가',1,1,'2023-05-05 00:00:00.000000','노래 잘 부르기',9,2),(14,'2021-01-02 00:00:00.000000','세종기지 방문했다~','','https://dreamgream-image-bucket.s3.ap-northeast-2.amazonaws.com/ai/member_2/e433bf40-53b8-4bb8-858b-6b432e38ad5c_2023-08-09.png',1,1,'전혀 모르는 대륙인 남극으로 가면서 전세계에서 볼 수 없었던 환상적인 풍경들과 동식물 종류를 만나보고싶어! 이번 여행은 생각보다 위험이 큰 것 같아 조심스럽게 준비할게.','2020-10-24 00:00:00.000000','1년이내',1,1,'2021-01-02 00:00:00.000000','남극 여행가기',1,3),(1